import React from 'react';
import classes from "./HeaderProfile.module.css";
import { NavLink } from "react-router-dom";

const HeaderProfile = () => {
    return (
        <div className={classes.headerProfile}>
            <option selected>
                <div className={classes.headerProfileImg}>
                    <img src="https://sun9-37.userapi.com/c628321/v628321677/3bc35/Nw-jx5UJK5k.jpg  " alt="logo"></img>
                </div>
                <h3>
                    Profile
                </h3>
            </option>
        </div>
    );
}

export default HeaderProfile;
